DELETE FROM ManageModuleScreenDetails
DBCC CHECKIDENT('ManageModuleScreenDetails', RESEED, 0)
DELETE FROM ManageModuleScreens
DBCC CHECKIDENT('ManageModuleScreens', RESEED, 0)

DECLARE @ModularScreenId INT
DECLARE @ScreenName varchar(250)
DECLARE @PrimaryKeyValue INT

IF OBJECT_ID('tempdb..#Screens') IS NOT NULL
	DROP TABLE #Screens	
CREATE TABLE #Screens(ScreenId int NULL)

DECLARE FA_cursor CURSOR FAST_FORWARD
FOR
SELECT ModularScreenId
	,[ScreenName]
FROM #ModularScreens
OPEN FA_cursor

FETCH NEXT
FROM FA_cursor
INTO @ModularScreenId
	,@ScreenName

WHILE @@FETCH_STATUS = 0
BEGIN    
	IF EXISTS (
			SELECT 1
			FROM #ModularScreens MS
			JOIN #ModularScreenDetails MSD ON MS.ModularScreenId = MSD.ModularScreenId
			JOIN Screens S ON MSD.ScreenId = S.ScreenId
			WHERE ISNULL(S.RecordDeleted, 'N') = 'N' AND MS.ModularScreenId = @ModularScreenId
			)
	BEGIN
		DELETE FROM #Screens
		
		INSERT INTO ManageModuleScreens(ModuleScreenName)
		VALUES(@ScreenName)
		SET @PrimaryKeyValue = @@Identity
		
		IF ISNULL(@PrimaryKeyValue,0) > 0
		BEGIN
			INSERT INTO #Screens(ScreenId)
			SELECT DISTINCT MSD.ScreenId
			FROM #ModularScreens MS
			JOIN #ModularScreenDetails MSD ON MS.ModularScreenId = MSD.ModularScreenId
			JOIN Screens S ON MSD.ScreenId = S.ScreenId
			WHERE ISNULL(S.RecordDeleted, 'N') = 'N' AND MS.ModularScreenId = @ModularScreenId
			
			INSERT INTO ManageModuleScreenDetails(ManageModuleScreenId,ScreenId)
			SELECT @PrimaryKeyValue,ScreenId FROM #Screens S
			WHERE NOT EXISTS(SELECT 1 FROM ManageModuleScreenDetails MMSD WHERE MMSD.ScreenId = S.ScreenId)
		END
	END

	FETCH NEXT
	FROM FA_cursor
	INTO @ModularScreenId
		,@ScreenName
END

CLOSE FA_cursor

DEALLOCATE FA_cursor
